import React from 'react';
import { useNavigate } from 'react-router-dom';

const WaitlistSignUp = () => {
  const navigate = useNavigate();

  const handleBack = () => {
    navigate('/');
  };

  return (
    <div className="relative w-full">
      {/* Background Image - Full size, allows scrolling */}
      <img 
        src="/assets/waitlist sign up.png" 
        alt="Waitlist Sign Up Background"
        className="w-full h-auto block"
      />
      
      {/* Back Button - Top Right Corner */}
      <button
        onClick={handleBack}
        className="fixed top-8 right-8 z-50 bg-white bg-opacity-80 hover:bg-opacity-100 text-dark-green font-metropolis font-bold px-6 py-3 rounded-lg shadow-lg transition-all duration-200 hover:scale-105"
      >
        ‚Üê Back
      </button>
    </div>
  );
};

export default WaitlistSignUp;
